import React, { Component } from 'react';
import '../index.css';




export default class Schedule extends React.Component{

      render(){
            console.log(this.props);
            return(
                  <div className="scheduleWrap">
                        <input type='date' onChange={this.props.changeStartDate} value={this.props.startDate} placeholder='Start date' style={styles.input}></input>
                        <input type='date' onChange={this.props.changeEndDate} value={this.props.endDate} placeholder='End date' style={styles.input}></input>
                  </div>

            )    
      }


}

const styles = {
      input:{
            margin:'auto',
            display:'block',
            padding:5,
            marginTop: 30,
            marginBottom: 30,
            border:'none',
      }
}
